# Change province and faction parameters according to start date
("initialize_start_date", [
(store_script_param, ":start_date", 1),
    (try_begin),
    (eq, ":start_date", 1861),
    (else_try),
    (eq, ":start_date", 1877),
    (array_set_val, "$provinces", faction_prussia, 0, province_owner),
    (else_try),
    (eq, ":start_date", 1914),
    (else_try),
    (eq, ":start_date", 1919),
    (else_try),
    (eq, ":start_date", 1936),
    (try_end),
]),

# Initializes all variables for fresh new game start according to chosen starting date.
("initialize_new_game", [
(store_script_param, ":start_date", 1),

(call_script, "script_initialize_global_containers"),

(array_set_val, "$globals", ":start_date", global_date_year),
(array_set_val, "$globals", 1, global_date_day_of_year),
(array_set_val, "$globals", 1, global_date_day_of_game),
(array_set_val, "$globals", 20000, global_world_map_camera_target_z),

(call_script, "script_initialize_factions", ":start_date"),
(call_script, "script_initialize_provinces"),
(call_script, "script_initialize_provinces_initparam_multipliers"),
(call_script, "script_initialize_objects_of_colonisation"),
(call_script, "script_initialize_rural_resource_bonuses"),
(call_script, "script_initialize_cores"),
(call_script, "script_initialize_capitals"),
(call_script, "script_initialize_provinces_initparam_multipliers"),
(call_script, "script_initialize_start_date", ":start_date"),

    (try_for_range, ":province", 0, number_of_provinces),
    (array_get_val, ":owner", "$provinces", ":province", province_owner),
    (array_set_val, "$provinces", ":owner", ":province", province_controller),
    (try_end),
(call_script, "script_initialize_faction_provinces_arrays"),
    (try_for_range, ":faction", 0, number_of_factions),
    (call_script, "script_faction_calculate_if_active", ":faction"),
    (try_end),

(call_script, "script_initialize_provinces_population_literacy_urbanization"),
(call_script, "script_initialize_distance_between_provinces"), # 1800 ms
(call_script, "script_initialize_provinces_distance_to_closest_coastal_province"), # 60 ms
    (try_for_range, ":province", 0, number_of_provinces),
    (call_script, "script_calculate_province_transportation_cost", ":province", ":province", number_of_provinces), # 6000 ms
    (try_end),
]),

