# Sets province material to color from red to green depending on min value, province value and max value - the closet province value is to max value, the greener color is.
# If provincevalue equals grayvalue, province material is set to gray
("set_province_color_redtogreen", [
(store_script_param, ":province", 1),
(store_script_param, ":minvalue", 2),
(store_script_param, ":provincevalue", 3),
(store_script_param, ":maxvalue", 4),
(store_script_param, ":grayvalue", 5),

(array_get_val, ":prop", "$provinces", ":province", province_prop1),
    (try_begin),
    (neq, ":provincevalue", ":grayvalue"),
        (try_begin), # if minimum is higher than maximum, swap them
        (gt, ":minvalue", ":maxvalue"),
        (assign, ":temp", ":minvalue"),
        (assign, ":minvalue", ":maxvalue"),
        (assign, ":maxvalue", ":temp"),
        (store_sub, ":provincevalue", ":maxvalue", ":provincevalue"),
        (try_end),
    (val_clamp, ":provincevalue", ":minvalue", ":maxvalue"),
        (try_begin), # minimum should always be zero
        (neq, ":minvalue", 0),
        (store_sub, ":difference", 0, ":minvalue"),
        (val_add, ":minvalue", ":difference"),
        (val_add, ":provincevalue", ":difference"),
        (val_add, ":maxvalue", ":difference"),
        (try_end),
    # provincevalue should become value from 0 to 9
    (val_mul, ":provincevalue", 10),
    (val_div, ":provincevalue", ":maxvalue"),
    (store_add, ":material_string", ":provincevalue", "str_color_redtogreen1"),
    (try_end),
    (try_begin),
    (neq, ":prop", -1),
        (try_begin),
        (neq, ":provincevalue", ":grayvalue"),
        (sss, s10, ":material_string"),
        (prop_instance_set_material, ":prop", -1, s10),
        (else_try),
        (sss, s10, "@solid_gray"),
        (prop_instance_set_material, ":prop", -1, s10),
        (try_end),
    (try_end),
]),

# Calculates distance between all provinces
("initialize_distance_between_provinces", [
(set_fixed_point_multiplier, 100),
(init_position, pos1),
(init_position, pos2),
    (try_for_range, ":province1", 0, number_of_provinces),
        (try_for_range, ":province2", ":province1", number_of_provinces),
        (array_get_val, ":x", "$provinces", ":province1", province_x),
        (array_get_val, ":y", "$provinces", ":province1", province_y),
        (position_set_x, pos1, ":x"),
        (position_set_y, pos1, ":y"),
        (array_get_val, ":x", "$provinces", ":province2", province_x),
        (array_get_val, ":y", "$provinces", ":province2", province_y),
        (position_set_x, pos2, ":x"),
        (position_set_y, pos2, ":y"),
        (get_distance_between_positions, ":distance", pos1, pos2),
        (array_set_val, "$provinces_to_provinces", ":distance", ":province1", ":province2", province_to_province_distance),
        (array_set_val, "$provinces_to_provinces", ":distance", ":province2", ":province1", province_to_province_distance),
        (try_end),
    (try_end),
]),

# Calculates distance to closest coastal province for all provinces, called at game start
("initialize_provinces_distance_to_closest_coastal_province", [
    (try_for_range, ":province1", 0, number_of_provinces),
        (try_begin),
        (neg|array_eq, "$provinces", -1, ":province1", province_bordering_sea_province1),
        (array_set_val, "$provinces", 0, ":province1", province_distance_to_closest_coastal_province),
        (else_try),
        (assign, ":done", 0),
        (assign, ":minimal_distance", 9999999),
        (dict_create, ":nearest_provinces"),
        (array_create, ":next_provinces_ring", 0, 0),
        (array_create, ":current_provinces_ring", 0, 0),
        (assign, reg0, ":province1"), (dict_set_int, ":nearest_provinces", "@{reg0}", ":province1"),
        (array_push, ":next_provinces_ring", ":province1"),
            (try_for_range, ":unused", 0, 4),
            (eq, ":done", 0),
            (array_free, ":current_provinces_ring"), (array_copy, ":current_provinces_ring", ":next_provinces_ring"),
            (array_free, ":next_provinces_ring"), (array_create, ":next_provinces_ring", 0, 0),
            (array_get_dim_size, ":size_current_provinces_ring", ":current_provinces_ring", 0),
                (try_for_range, ":index_current_provinces_ring", 0, ":size_current_provinces_ring"),
                (array_get_val, ":province_current_provinces_ring", ":current_provinces_ring", ":index_current_provinces_ring"),
                    (try_for_range, ":index", 0, number_of_provinces_borders),
                        (try_begin),
                        (array_eq, "$provinces_borders", -1, ":province_current_provinces_ring", ":index"),
                        (break_loop),
                        (try_end),
                    (array_get_val, ":province2", "$provinces_borders", ":province_current_provinces_ring", ":index"),
                        (try_begin),
                        (neg|array_eq, "$provinces", -1, ":province2", province_bordering_sea_province1),
                        (array_get_val, ":distance", "$provinces_to_provinces", ":province1", ":province2", province_to_province_distance),
                            (try_begin),
                            (lt, ":distance", ":minimal_distance"),
                            (assign, ":minimal_distance", ":distance"),
                            (assign, ":done", 1),
                            (try_end),
                        (else_try),
                        (assign, reg0, ":province2"), (neg|dict_has_key, ":nearest_provinces", "@{reg0}"),
                        (dict_set_int, ":nearest_provinces", "@{reg0}", ":province2"),
                        (array_push, ":next_provinces_ring", ":province2"),
                        (try_end),
                    (try_end),
                (try_end),
            (else_try),
            (break_loop),
            (try_end),
            (try_begin),
            (val_min, ":minimal_distance", 5000),
            (array_set_val, "$provinces", ":minimal_distance", ":province1", province_distance_to_closest_coastal_province),
            (try_end),
        (dict_free, ":nearest_provinces"),
        (array_free, ":current_provinces_ring"),
        (array_free, ":next_provinces_ring"),
        (try_end),
    (try_end),
    # (try_for_range, ":province", 0, number_of_provinces),
    # (array_get_val, ":distance", "$provinces", ":province", province_distance_to_closest_coastal_province),
    # (call_script, "script_set_province_color_redtogreen", ":province", 4000, ":distance", 0, -1),
    # (try_end),
]),

# Calculates transportation costs of specified province to all specified provinces
("calculate_province_transportation_cost", [
(store_script_param, ":province1", 1),
(store_script_param, ":start_index", 2),
(store_script_param, ":end_index", 3),

# get province1 railroads and coastal distance
(call_script, "script_get_province_railroads", ":province1"), (assign, ":railroads_province1", reg0), (assign, ":coastal_distance1", reg1), (array_get_dim_size, ":size_railroads_province1", ":railroads_province1", 0),
            
    (try_for_range, ":province2", ":start_index", ":end_index"),
    # get distance between provinces which is base for cost calculation
    (array_get_val, ":cost", "$provinces_to_provinces", ":province1", ":province2", province_to_province_distance),
    (assign, ":cost_add", ":cost"),
    (val_clamp, ":cost_add", 0, 4500),
    (val_add, ":cost", ":cost_add"),
    # get province1 railroads and coastal distance
    (call_script, "script_get_province_railroads", ":province2"), (assign, ":railroads_province2", reg0), (assign, ":coastal_distance2", reg1), (array_get_dim_size, ":size_railroads_province2", ":railroads_province2", 0),
        (try_begin),
        (neq, ":size_railroads_province1", 0),
        (neq, ":size_railroads_province2", 0),
        (assign, ":railroad_connection_level", 0),
        # if both provinces have railroads, check for railroads number intersection
            (try_begin),
            (array_get_val, ":province1_railroad", "$provinces", ":province1", province_railroad),
            (array_get_val, ":province2_railroad", "$provinces", ":province2", province_railroad),
            (eq, ":province1_railroad", ":province2_railroad"),
            (assign, ":railroad_connection_level", 7),
            # both provinces share same railroad
            (else_try),
                (try_for_range, ":index_railroads_province1", 1, ":size_railroads_province1"),
                    (try_begin),
                    (neq, ":railroad_connection_level", 0),
                    (break_loop),
                (array_get_val, ":railroad1", "$railroads", ":index_railroads_province1"),
                    (try_end),
                    (try_for_range, ":index_railroads_province2", 1, ":size_railroads_province2"),
                    (array_get_val, ":railroad2", "$railroads", ":index_railroads_province1"),
                    (eq, ":railroad1", ":railroad2"),
                    # both provinces share same railroad near them
                    (assign, ":railroad_connection_level", 5),
                    (try_end),
                (try_end),
            (try_end),
        (neq, ":railroad_connection_level", 0),
        (val_div, ":cost", ":railroad_connection_level"),
        (else_try),
        # if no railroad connection - decrease cost based on coastal distance
        # both coastal distances will decrease cost up to 66% each
        (val_div, ":coastal_distance1", 75), (val_add, ":coastal_distance1", 33),
        (val_div, ":coastal_distance2", 75), (val_add, ":coastal_distance2", 33),
        (val_mul, ":cost", ":coastal_distance1"), (val_div, ":cost", 100),
        (val_mul, ":cost", ":coastal_distance2"), (val_div, ":cost", 100),
        (try_end),
    (array_set_val, "$provinces_to_provinces", ":cost", ":province1", ":province2", province_to_province_transportation_cost),
    (array_set_val, "$provinces_to_provinces", ":cost", ":province2", ":province1", province_to_province_transportation_cost),
    (array_free, ":railroads_province2"),
    (try_end),
    
(array_free, ":railroads_province1"),
]),

# Returns:
# reg0 - array with railroads of specified province and provinces around it 
# reg1 - coastal distance, decreased if province1 has railroad near it with access to sea
("get_province_railroads", [
(store_script_param, ":province1", 1),

(array_create, ":railroads", 0, 0),
(assign, reg0, -1),
(array_get_val, reg1, "$provinces", ":province1", province_distance_to_closest_coastal_province),
(assign, ":distance_decreased", 0),
    (try_begin),
    (neg|array_eq, "$provinces", -1, ":province1", province_railroad),
    (array_get_val, ":railroad", "$provinces", ":province1", province_railroad),
    (array_push, ":railroads", ":railroad"),
    (array_get_val, ":railroad_array", "$railroads", ":railroad"),
    (array_get_val, ":access_to_sea", ":railroad_array", 1),
        (try_begin),
        (eq, ":access_to_sea", 1),
        (val_div, reg1, 10),
        (assign, ":distance_decreased", 1),
        (try_end),
    (try_end),
    (try_for_range, ":index", 0, number_of_provinces_borders),
        (try_begin),
        (array_eq, "$provinces_borders", -1, ":province1", ":index"),
        (break_loop),
        (try_end),
    (array_get_val, ":province2", "$provinces_borders", ":province1", ":index"),
        (try_begin),
        (neg|array_eq, "$provinces", -1, ":province2", province_railroad),
        (array_get_val, ":railroad", "$provinces", ":province2", province_railroad),
        (array_push, ":railroads", ":railroad"),
            (try_begin),
            (eq, ":distance_decreased", 0),
            (array_get_val, ":railroad_array", "$railroads", ":railroad"),
            (array_get_val, ":access_to_sea", ":railroad_array", 1),
            (eq, ":access_to_sea", 1),
            (val_div, reg1, 3),
            (assign, ":distance_decreased", 1),
            (try_end),
        (try_end),
    (try_end),
(assign, reg0, ":railroads"),
]),

